import Document, { Html, Head, Main, NextScript } from "next/document";

class MyDocument extends Document {
  static async getInitialProps(ctx) {
    const initialProps = await Document.getInitialProps(ctx);
    return { ...initialProps };
  }

  render() {
    return (
      <Html lang="es">
        <Head>
          <meta charSet="UTF-8" />
          {/* Google Tag Manager */}
          <script
            dangerouslySetInnerHTML={{
              __html: `(function(w,d,s,l,i){w[l]=w[l]||[];w[l].push({'gtm.start':
                new Date().getTime(),event:'gtm.js'});var f=d.getElementsByTagName(s)[0],
                j=d.createElement(s),dl=l!='dataLayer'?'&l='+l:'';j.async=true;;j.src=
                'https://www.googletagmanager.com/gtm.js?id='+i+dl;f.parentNode.insertBefore(j,f);
                })(window,document,'script','dataLayer','${process.env.NEXT_PUBLIC_GTM_ID}');`,
            }}
          />
          {/* End Google Tag Manager */}
          {/* Google Tag Manager (noscript) */}
          <noscript
            dangerouslySetInnerHTML={{
              __html: `<iframe src="https://www.googletagmanager.com/ns.html?id=${process.env.NEXT_PUBLIC_GTM_ID}" height="0" width="0" style="display:none;visibility:hidden"></iframe>`,
            }}
          />
          {/* End Google Tag Manager (noscript) */}

          <meta
            name="description"
            content="Ahorra desde el primer día, hasta el 70% en tu factura de luz con energía 100% verde, instalando paneles solares para tu vivienda y a tu medida. ¡Únete al  Autoconsumo!"
          />
          <meta
            name="keywords"
            content="energía Solar, paneles solares precio, paneles solares fotovoltaicos, instalacion de paneles solares, paneles solares tejado, autoconsumo residencial, paneles solares para autoconsumo, placas solares precio, placas solares fotovoltaicos, instalacion de placas solares, placas solares tejado, paneles solares vivienda, placas solares vivienda, empresas de paneles solares, empresas de instalacion de placas solares"
          />
          <meta httpEquiv="X-UA-Compatible" content="IE=edge" />
          <meta
            name="google-site-verification"
            content="bAqN3ArH6CGYliwgASphpg7Y_Q0ceNApapGW9rD0stU"
          />

          <link rel="Canonical" href="https://haymasenergia.es/" />
        </Head>
        <body>
          <noscript
            dangerouslySetInnerHTML={{
              __html: `<!-- Load Facebook SDK for JavaScript -->
      <div id="fb-root"></div>
      <script>
        window.fbAsyncInit = function() {
          FB.init({
            xfbml            : true,
            version          : 'v8.0'
          });
        };

        (function(d, s, id) {
        var js, fjs = d.getElementsByTagName(s)[0];
        if (d.getElementById(id)) return;
        js = d.createElement(s); js.id = id;
        js.src = 'https://connect.facebook.net/en_US/sdk/xfbml.customerchat.js';
        fjs.parentNode.insertBefore(js, fjs);
      }(document, 'script', 'facebook-jssdk'));</script>

      <!-- Your Chat Plugin code -->
      <div className="fb-customerchat"
        attribution=setup_tool
        page_id="103993817624712">
      </div>`,
            }}
          />
          {/* End Google Tag Manager (noscript) */}

          <Main />
          <NextScript />
        </body>
      </Html>
    );
  }
}

export default MyDocument;
